    $scope.getWinePairing = function () {
        if (!$scope.dish) {
            $scope.errorMessage = 'Please enter a dish to find a pairing!';
            $scope.pairingData = null;
            return;
        }

        const dishLower = $scope.dish.toLowerCase();
        if (mockPairings[dishLower]) {
            $scope.pairingData = mockPairings[dishLower];
            $scope.errorMessage = null;
        } else {
            $scope.errorMessage = `Sorry, we couldn't find any pairing for ${$scope.dish}.`;
            $scope.pairingData = null;
        }
    };
